import products from "./products.json"


const ProductsList = () => {

  data = JSON.parse(products);

  const { id, name, price, image } = products
  return
  (
    <div>
    <h1>hi</h1>
    {products.map(product => <div key={id}>
      <h2>{name}</h2>
      <h3>{price}</h3>
      <img src={image} />
      </div>
      )}
    </div>
      )
}

export default ProductsList;
